import React, { useState } from "react";

const App = () => {
  const state = useState();
  const [count, setCount] = useState(100);

  const IncNum = () => {
    setCount(count + 1);
  };
  return (
    <React.Fragment>
      <h1>{count}</h1>
      <button onClick={IncNum}>Click me!</button>
    </React.Fragment>
  );
};

export default App;
